import React from 'react';
import ReactDOM from 'react-dom';
import { StadiaPlusDB } from '../../shared/StadiaPlusDB';
import { StadiaGameDB } from './StadiaGameDB';
import Fonts from './Fonts';
import GameSettingsComponent from './components/GameSettingsComponent/GameSettingsComponent';
import InitLibraryComponent from './components/InitLibraryComponent';
import GameMonitorComponent from './components/GameMonitorComponent/GameMonitorComponent';
import CodecComponent from './components/CodecComponent';
import InGameSyncComponent from './components/InGameSyncComponent';
import ResolutionComponent from './components/ResolutionComponent';
import { createNavigationHook, findPage, getCurrentPage, setPage } from './StadiaPage';
import { StadiaSelectors } from './StadiaSelectors';
import Logger from '../../shared/Logger';
import { observer } from 'mobx-react';
import StateStore, { stateStore } from './state/StateStore';
import { desandbox, observeAddedNodes, setRenderer, updateRenderer } from './Util';
import '../../shared/root.css';

Logger.image(
    'data:image/png;base64,',
    402, 208
);


document.addEventListener('DOMContentLoaded', async () => {
    Fonts.load('Overpass', [200, 300, 400, 700]);

    StadiaPlusDB.connect('http://localhost:3000').then(() => {
        StadiaPlusDB.authenticate();
        StadiaGameDB.update();
    });

    const root = document.createElement('div');
    root.id = 'stadiaplus-root';
    document.body.appendChild(root);

    const RootComponent = (props: {stateStore: StateStore}) => (
        <>
            <ResolutionComponent    store={stateStore} />
            <InitLibraryComponent   store={stateStore} />
            <CodecComponent         store={stateStore} />
            <ResolutionComponent    store={stateStore} />
            <InGameSyncComponent    store={stateStore} />
            <GameMonitorComponent   store={stateStore} />
            <GameSettingsComponent/>
        </>
    );

    const ObservedComponent = observer(RootComponent);
    ReactDOM.render(<ObservedComponent stateStore={stateStore} />, root);

    observeAddedNodes(document.querySelector(StadiaSelectors.RENDERER_CONTAINER)!, 'childList', Node.ELEMENT_NODE, (mutation: MutationRecord, node: Node) => {
        if (mutation.addedNodes.length > 0) {
            const renderer = mutation.addedNodes.item(0) as HTMLElement;
            if (renderer != null) {
                setRenderer(renderer)
                setPage(findPage(location.pathname));
            }
        }
    });
    setPage(findPage(location.pathname));

    updateRenderer();
    desandbox(createNavigationHook, { immediate: true });
});